import React from 'react';
import Head from 'next/head';
import { AppLayout } from '../components';
import { Form, Input } from 'antd';

type FieldType = {
  userId: string;
  userName: string;
  password: string;
};

const Signup = () => {
  const [form] = Form.useForm();

  const onSubmit = () => {
    const { userId, userName, password }: FieldType = form.getFieldsValue();
    console.log(userId, userName, password);
  };

  return (
    <AppLayout>
      <Head>
        <title>Sign Up | Next Tweet</title>
      </Head>
      <Form
        form={form}
        onFinish={onSubmit}>
        <Form.Item<FieldType>
          label='ID'
          name='userId'>
          <Input />
        </Form.Item>
        <Form.Item<FieldType>
          label='Nickname'
          name='userName'>
          <Input />
        </Form.Item>
        <Form.Item<FieldType>
          label='Password'
          name='password'>
          <Input type='password' />
        </Form.Item>
      </Form>
    </AppLayout>
  );
};

export default Signup;
